import React from 'react';
import './App.css';
import Data from './colleges.json'

function App() {
  const productComponents =  Data.map((post) => {
    return (
      <>
        <h1>{post.discount}</h1>
      </>
    )
  })
  return (
    <div className="App">

     <h1>{productComponents}</h1>
      </div>

  );
}

export default App;
